function createCookie() {
    let cookie = Date.now()
    console.log(cookie)
    return cookie
}

function getElapsedTime(cookie) {
    let elapsedTime = cookie - Date.now()
    return elapsedTime
}

function getCookie(cookie) {
    if (cookie) {
        return cookie
    }
}
